import React from 'react';
import './Card.css';

const Card = (props) => {

    return (
        <div className='wrapper'>
            <tr>id:{props.id}</tr>
            <p>name:{props.name}</p>
            <p>date:{props.date}</p>
        </div>
    );
};

export default Card;
